import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import { Nav, Navbar, Button } from "react-bootstrap";
import { BrowserRouter } from "react-router-dom";
import About from './About';
function Navigation() {
  return (
    <div id="nav">
  <BrowserRouter>
    <Navbar className="color-nav" variant="light">
          <Navbar.Brand><a href="home.js">NatureKnitter</a></Navbar.Brand>
          <Nav>
            <Button variant="light" href="products.js">Products</Button>
          </Nav>
          <div class="divider"/>
          
          <Nav>
              <Button variant="light" href="about.js">
                  About               
              </Button>
          </Nav>
        </Navbar>
               </BrowserRouter>
    </div>
  );
}
export default Navigation;
